script: |
  super -f text -I q5450.spq | sort > q5450.out

inputs:
  - name: q5450.spq
    data: |
      SELECT DISTINCT - col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 * col2 NOT BETWEEN col0 AND + 84 * - 80 - + + ( - 95 );
  - name: tab0

outputs:
  - name: q5450.out
    data: |
      -10
      -47
      -99
